import { Alert } from 'react-bootstrap'
function Messageloginscreen() {
  return (
    <Alert  variant='danger'  dismissible>Request Failed With Status Code 404
    <Alert.Heading>Ooops! an error occured!</Alert.Heading></Alert>
  )
}

export default Messageloginscreen
